import { Ollama } from "langchain/llms/ollama";
import { JsonObject, JsonSpec } from "langchain/tools";

async function main() {
  let data: JsonObject;
  try {
    data = {
      name: "John Doe",
      age: 30,
    };

    if (!data) {
      throw new Error("Failed to load");
    }
  } catch (e) {
    console.log("here");
    console.error(e);
    return;
  }

  const toolkit = new JsonToolkit(new JsonSpec(data));

  const model = new Ollama({
    baseUrl: "http://localhost:11434",
    model: "llama2",
  });

  const executor = createJsonAgent(model, toolkit);

  const input = `What is the age of John Doe?`;

  console.log(`Executing with input "${input}"...`);

  let result;
  try {
    result = await executor.call({ input });
  } catch (err) {
    console.error("result error", err);
  }

  console.log(`Got output ${result}`);
}

main();
```

If i use the openapi model it works, but my goal is to use a private llm for this task, how should i do that?

**resources:**
https://js.langchain.com/docs/modules/agents/toolkits/json
