```ts
static getDefaultPlanner({ llm }: { llm: BaseLanguageModel }) {
  const plannerLlmChain = new LLMChain({
    llm,
    prompt: PLANNER_CHAT_PROMPT,
  });
  return new LLMPlanner(plannerLlmChain, new CustomPlanOutputParser());
}
```

