  humanMessageTemplate?: string;
} & Omit<PlanAndExecuteAgentExecutorInput, "planner" | "stepExecutor">) {
  const executor = new PlanAndExecuteAgentExecutor({
    planner: PlanAndExecuteAgentExecutor.getDefaultPlanner({ llm }),
